<p>再加上文件放在云存储上，毕竟是公家的，文件上传都会被扫描一遍，毫无隐私可言，万一想存点嘿嘿的东西，那怎么办呢？而且公有云存储的存储有限，其次安全性和稳定性也不能一直保证，毕竟是放在别人家里，别人未必会帮你好好保存。</p>
